import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Grid from '@material-ui/core/Grid';
import LoggedInButtonAppBar from "../components/LoggedInButtonAppBar/index";
import Card from '@material-ui/core/Card';
import CardMedia from '@material-ui/core/CardMedia';
import Container from '@material-ui/core/Container';
import Button from '@material-ui/core/Button';
import { Link } from "react-router-dom";

const useStyles = makeStyles((theme) => ({
    root: {
        flexGrow: 1,
    },
    cardGrid: {
        paddingTop: theme.spacing(8)
    },
    card: {
        height: '100%',
        position: 'relative',

    },
    cardMedia: {
        paddingTop: '82.25%', // 16:9
    },
    cardContent: {
        flexGrow: 1,
    },
    button: {
        fontSize: "28px",
        fontWeight: "bolder",
        color: "white",
        position: "absolute",
        top: "50%",
        left: "50%",
        transform: "translate(-50%, -50%)",
        opacity: ".9",
        height: "100%",
        width: "100%",
        letterSpacing: "8px",
    }
}));

export default function FullWidthGrid() {
    const classes = useStyles();

    return (
        <div>
            <LoggedInButtonAppBar />
            <div>
                <Container className={classes.cardGrid} maxWidth="md">
                    {/* End hero unit */}
                    <Grid container spacing={4}>
                        <Grid xs={12} sm={6} md={4}>
                            <Card className={classes.card}>
                                <CardMedia
                                    className={classes.cardMedia}
                                    image="images/videos/crossfit.jpg">
                                    <Link style={{ color: "black", textDecoration: "none" }} to={"/crossfitVids"}>
                                        <Button className={classes.button}>CROSSFIT
                                </Button>
                                    </Link>
                                </CardMedia>
                            </Card>
                        </Grid>
                        <Grid xs={12} sm={6} md={4}>
                            <Card className={classes.card}>
                                <CardMedia
                                    className={classes.cardMedia}
                                    image="images/videos/run.jpg">
                                    <Link style={{ color: "black", textDecoration: "none" }} to={"/runningVids"}>
                                        <Button className={classes.button}>RUNNING</Button>
                                    </Link>
                                </CardMedia>
                            </Card>
                        </Grid>
                        <Grid xs={12} sm={6} md={4}>
                            <Card className={classes.card}>
                                <CardMedia
                                    className={classes.cardMedia}
                                    image="images/videos/cycling.jpg">
                                    <Link style={{ color: "black", textDecoration: "none" }} to={"/cyclingVids"}>
                                        <Button className={classes.button}>CYCLING
                                        </Button>
                                    </Link>
                                </CardMedia>
                            </Card>
                        </Grid>
                        <Grid xs={12} sm={6} md={4}>
                            <Card className={classes.card}>
                                <CardMedia
                                    className={classes.cardMedia}
                                    image="images/videos/yoga.jpg">
                                    <Link style={{ color: "black", textDecoration: "none" }} to={"/yogaVids"}>
                                        <Button className={classes.button}>YOGA</Button>
                                    </Link>
                                </CardMedia>
                            </Card>
                        </Grid>
                        <Grid xs={12} sm={6} md={4}>
                            <Card className={classes.card}>
                                <CardMedia
                                    className={classes.cardMedia}
                                    image="images/videos/hiit.jpg">
                                    <Link style={{ color: "black", textDecoration: "none" }} to={"/hiitVids"}>
                                        <Button className={classes.button}>HIIT</Button>
                                    </Link>
                                </CardMedia>
                            </Card>
                        </Grid>
                        <Grid xs={12} sm={6} md={4}>
                            <Card className={classes.card}>
                                <CardMedia
                                    className={classes.cardMedia}
                                    image="images/videos/pilates.jpg">
                                    <Link style={{ color: "black", textDecoration: "none" }} to={"/pilatesVids"}>
                                        <Button className={classes.button}>PILATES</Button>
                                    </Link>
                                </CardMedia>
                            </Card>
                        </Grid>
                    </Grid>
                </Container>
            </div>
        </div>
    );
}
